var t0;

function min0(a, b) {
  if (a < 0 || b < 0)
  	return 0;
  if (a < b)
  	return a;
  return b;
}

function move(left, right) {
  var K = 0.6;
  var v1 = 60;
  var int = 0;
  var ci = 0.05;
  var sV = 50;

  var leftEnc = brick.encoder("B4");
  var rightEnc = brick.encoder("B3");

  var leftM = brick.motor(M4);
	var rightM = brick.motor(M3);

	//leftM.setPower(101);
	//rightM.setPower(101);

  var l = leftEnc.readRawData();  
  var r = rightEnc.readRawData();
  
  var diffl = left - l;
  var diffr = r - right;
  var cl = 0, cr = 0;
    
  if (diffl < diffr) { 
    cl = diffl * 1.0 / diffr;
    cr = 1;
  } else {
  	cl = 1;
  	cr = diffr * 1.0 / diffl;
  } 

  while (l < left && r > right) {
    l = leftEnc.readRawData();
    r = rightEnc.readRawData();
    diffl = left - l;
    diffr = right - r;
    var diff = diffl * cr + diffr * cl;

    var u = K * diff + int;

    rightM.setPower(min0(100, v1 - u));
    leftM.setPower(min0(100, v1 + u));
    
    script.wait(retPeriod);
    l = leftEnc.readRawData();
    r = rightEnc.readRawData();
    leftArr.push(l);
    rightArr.push(r);
    timeArr.push(script.time() - t0);
  }

  while (l < left) {
    rightM.setPower(0);
    if (l - left <= diffEncs)
    	leftM.setPower(sV);
    else
      leftM.setPower(v1);
    script.wait(retPeriod);
    l = leftEnc.readRawData();
    leftArr.push(l);
    rightArr.push(rightEnc.readRawData());
    timeArr.push(script.time() - t0);
  } 
  while (r > right) {
	  leftM.setPower(0);
    if (right - r <= diffEncs)
    	rightM.setPower(sV);
    else
      rightM.setPower(v1);
    script.wait(retPeriod);
    r = rightEnc.readRawData();
    rightArr.push(r);
    leftArr.push(leftEnc.readRawData());
    timeArr.push(script.time() - t0);
  } 
  //leftM.setPower(0);
  //rightM.setPower(0);
} 

function moveStraight(left, right) {
  var K = 0.7;
  var v1 = 70;
  var int = 0;
  var ci = 0.7;

  var leftEnc = brick.encoder("B4");
  var rightEnc = brick.encoder("B3");

  var leftM = brick.motor(M4);
	var rightM = brick.motor(M3);

	leftM.setPower(0);
	rightM.setPower(0);

  var l = leftEnc.readRawData();  
  var r = rightEnc.readRawData();
  var diffl = l - left;
  var diffr = r - right;

  while (l < left && r > right) {
    l = leftEnc.readRawData();
    r = rightEnc.readRawData();
    diffl = left - l;
    diffr = right - r;
    var diff = diffl + diffr;

    int += ci * diff;
    var u = K * diff + int;
    rightM.setPower(v1 - u);
    leftM.setPower(v1 + u);
    
    script.wait(retPeriod);
    l = leftEnc.readRawData();
    r = rightEnc.readRawData();
  } 

  leftM.setPower(0);
  rightM.setPower(0);
} 

function stop() {
  print("Stopped!");
  var leftM = brick.motor(M1);
	var rightM = brick.motor(M2);

	while (true) {
	  leftM.setPower(0);
	  rightM.setPower(0);
	}
}
  
